import React from 'react'
import { useSelector } from 'react-redux'

export default function TodoLists() {
    const selector = useSelector(store=>store)
    const taskLists = selector.tasks

    const item = taskLists.map((task)=>{
        return(
            <h5>{task}</h5>)
    })
    return (
        <div>
            <h1>Tasks are :</h1>
             {item}   
        </div>
    )
}
